There are several artists named The Crusaders;

1) The Crusaders were an American jazz fusion group that was successful from the 1960s to the 1980s. The group was known as The Jazz Crusaders from its formation in 1960 until shortening its name in 1971.

High school friends Joe Sample (piano), Wilton Felder (tenor saxophone) and Nesbert "Stix" Hooper (drums) formed their first band together, the Swingsters, in Houston, Texas in 1954. They played a mixture of jazz and R&B <a href="https://www.last.fm/music/The+Crusaders">Read more on Last.fm</a>

There are multiple artists sharing the name Fabe;

1)  Farbod Karimi, popularly known as Fabe, is a Finnish-Iranian artist. He was previously known as Le Fvbelos.

2)  Fabe est un rappeur français d'origine martiniquaise, né le 9 mai 1971 à Paris. Son pseudonyme est le diminutif du prénom Fabrice. Enfant issu des quartiers populaires, c'est dans le 10e arrondissement de Paris que Fabe grandit. Il déménage à Annecy avec sa mère, à l'âge de 12 ans, afin de soigner un eczéma chronique. <a href="https://www.last.fm/music/Fabe">Read more on Last.fm</a>
